import React, {useState, useEffect} from 'react';
import axios from 'axios';
import {BACK_URL, DOMAIN_URL} from '../../http';
import Navigation from '../navigation/Navigation';
import './diplomes.css';

const Diplomas = () => {
    const [diplomes, setDiplomes] = useState([]); 

    useEffect(() => {
         const fetchDiplomes = () => {
            axios
            .get(`${BACK_URL}/diplomes`)
            .then(res => setDiplomes(res.data))
         }
         fetchDiplomes()   
     }, []);

    return (
        <div>
            <Navigation />
            <div className="diplome-container">
                    {diplomes.map((exp) => (
                        <div className="-map" key={exp.id}>
                            <div className="exp-date">
                                <h4>{exp.date_debut}</h4>
                                <h4>{exp.date_fin}</h4> 
                            </div>
                            <div className="description-exp">
                                <h3>{exp.position}</h3>
                                <h4>{exp.company}</h4>
                                <h5>- {exp.description_1}</h5>
                                <h5>- {exp.description_2}</h5>
                                <h5>- {exp.description_3}</h5>
                            </div> 
                        </div>
                    ))} 
                </div> 
        </div>
    );
};

export default Diplomas;
